import axios from "axios";

const employeeServiceBaseUrl = "http://localhost:9191/api/employees";

const EMPLOYEE_ID = 2;

class EmployeeService {
  getEmployee() {
    return axios.get(employeeServiceBaseUrl + "/" + EMPLOYEE_ID);
  }
}

export default new EmployeeService();
